const TimeDiv = {
  display: 'flex',
  width: '100%',
}

const HourDiv = {
  display: 'flex',
  flexDirection: 'row',
  width: '100%',
  fontSize: 20,
  justifyContext: 'center',
  alignItems: 'center',
}

const Horizontal = {
  width: '95%',
  height: '1px',
  background: 'black',
  leftPadding: '5%'
}

function Time() {
  return (
  <div style={TimeDiv}>
    <div style={HourDiv}>
      8 
      <div style={Horizontal}></div>
    </div>
  </div>
  )
}

export default Time;
